export * from "./workoutUtils";

export const groupObjectsByProperty = (objectArray, property) => {
  return objectArray.reduce(function(acc, obj) {
    let key = obj[property];
    if (!acc[key]) {
      acc[key] = [];
    }
    acc[key].push(obj);
    return acc;
  }, {});
};
